enum RatingFaces {
  Disappointment(1),
  Displeasure(2),
  Neutral(3),
  Satisfaction(4),
  Joy(5);

  const RatingFaces(this.value);
  final int value;

  String _getCode({
    String? shirtColor,
    String? collarColor,
    String? hairColor,
  }) {
    final String shirt = shirtColor ?? const Color(0xFFA36B4C).toRGBACode();
    final String collar = collarColor ?? const Color(0xFF2F1F11).toRGBACode();
    final String hair = hairColor ?? const Color(0xFF2F2E41).toRGBACode();

    switch (this) {
      case RatingFaces.Disappointment:
        return _RatingsFaceOne.getCode(
          shirt: shirt,
          collar: collar,
          hair: hair,
        );
      case RatingFaces.Displeasure:
        return _RatingsFaceTwo.getCode(
          shirt: shirt,
          collar: collar,
          hair: hair,
        );
      case RatingFaces.Neutral:
        return _RatingsFaceThree.getCode(
          shirt: shirt,
          collar: collar,
          hair: hair,
        );
      case RatingFaces.Satisfaction:
        return _RatingsFaceFour.getCode(
          shirt: shirt,
          collar: collar,
          hair: hair,
        );
      case RatingFaces.Joy:
        return _RatingsFaceFive.getCode(
          shirt: shirt,
          collar: collar,
          hair: hair,
        );
    }
  }
}

